def get_data():
    wifi = pywifi.PyWiFi()
    iface = wifi.interfaces()[0]
    iface.scan()
    time.sleep(1)
    bsses = iface.scan_results()
    signals = []
    for address in bsses:
        signals.append([address.bssid, address.signal])
    return signals

